import React from 'react';
import Typewriter from "typewriter-effect";


export class LandingPage extends React.Component {

    render() {
        return(
            <div className='mt-32 flex items-center justify-center'>

                <div className='h-32 w-64 rounded bg-violet-300 flex items-center justify-center shadow-2xl hover:bg-violet-600'>
                    <h1 className='text-3xl'>
                        <Typewriter 
                            options = {{
                                strings: ["Welcome", "Bienvenido", "Salut", "Privet", "Yōkoso"],
                                autoStart: true,
                                loop: true,
                                cursor: "_"
                            }}
                        />
                    </h1>
                </div>

            </div>
        );
    }
}
